    [],nt"revision_timestamp": "2016-01-30T06:44:23.819671",nt"name": "market-squid-ecology-dataset",nt"isopen":
    false,nt"url": null,nt"notes": "This dataset contains ecological information
    collected on the major adult spawning and juvenile habitats of market squid off
    California and the US Pacific Northwest. These data were collected from SWFSC surveys,
    cooperative research surveys and collaborative sampling research program with the
    California Department of Fish and game. Particularly, the dataset will include information
    on: (1) physical and chemical characteristics of regional market spawning habitats;
    (2) squid statolith stable isotopes and trace element chemistry; and (3) regional
    distribution-at-age and at-size of market squid across various life stages. To ensure
    confidentiality, site specific information collected from cooperative research surveys
    with the fishing industry will not be made available.",nt"license_title": null,nt"extras":
